import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <div>Hello wor!</div>,
  },
]);

function App() {
  return (
    <div>
      <RouterProvider router = {router}/>
    </div>
  );
}

export default App;
